criteria.textblock:
        Inclusion Criteria:

          1. Signing of the Informed Consent Form;

          2. Male sex;

          3. Age of 18 to 45 years, inclusive;

          4. BMI within normal limits (18.5-24.9 kg/m2);

          5. Healthy patients, which is proved by their medical history, physical examination and
             laboratory findings:

               -  No clinically significant abnormalities of circulatory, respiratory, nervous,
                  hematopoietic, endocrine and digestive systems, liver and kidneys in the past
                  medical history and at screening;

               -  No history of cardiovascular disorders or thyroid disorders;

               -  No history of hematologic disorders, including but not limited to any type of
                  anemia, myelodysplastic syndrome, blood cancers, hemolytic syndrome,
                  hemoglobinopathies, coagulopathies;

               -  CBC results within normal limits, including:

                    -  Hemoglobin within 132-173 g/L;

                    -  Hematocrit (based on CBC results) within 39-49%;

                    -  Platelet count within 150-400*109/L;

                    -  Absolute reticulocyte count within 30.4-93.5 * 109/L;

               -  Blood biochemistry and urinalysis results within normal limits;

               -  Serum ferritin within 20-250 ¬µg/L;

               -  Serum endogenous erythropoietin within 4.3-29.0 MIU/mL;

               -  Hemodynamic parameters within normal limits: systolic blood pressure within
                  100-139 mmHg; diastolic blood pressure within 60-90 mmHg; heart rate within 50-90
                  bpm;

               -  No history of chronic infections (tuberculosis) or chronic inflammation;

               -  No hepatitis B or C, HIV, or syphilis;

               -  No acute infections within 4 weeks prior to inclusion in the study;

               -  No psychiatric disorders and other conditions (including depression) that can
                  interfere with the volunteer's ability to follow the study protocol;

               -  Well-being (in the volunteer's opinion) within 30 days prior to inclusion in the
                  study;

          6. No history of or current (at baseline) alcohol or drug abuse;

          7. Ability of the volunteer, in the investigator's opinion, to follow the study protocol
             procedures;

          8. Willingness of volunteers and their sexual partners with preserved reproductive
             potential to use reliable contraception within 2 weeks before inclusion in the study
             and up to 7 weeks after the injection of the test product. This criterion is not
             applicable to subjects who underwent surgical sterilization. Reliable methods of
             contraception include one barrier method in combination with one of the following
             methods: spermicides, intrauterine device/oral contraceptives (for sexual partners).

          9. Willingness of volunteers to avoid alcohol intake within 24 hours before and 8 days
             after each injection of the test drug;

        Exclusion Criteria:

          1. History of treatment with erythropoietins or any other ESAs;

          2. Acute bleeding, blood/plasma donation or blood transfusion within 2 months before
             inclusion in the study;

          3. History of chronic bleeding;

          4. Standard laboratory and instrumental findings outside normal limits at screening;

          5. History of allergies (anaphylactic shock or multiple drug allergy syndrome);

          6. Known allergy or intolerance to any components of the investigational product;

          7. Major surgery within 30 days prior to screening, or surgery being scheduled for any
             time during the study;

          8. Impossibility to install a venous catheter for blood sampling (e.g. because of skin
             disorders at the sites of venipuncture);

          9. Diseases or other conditions that can interfere with the pharmacokinetics of the
             investigational drug (e.g. chronic liver, kidney, blood, circulatory system, lung or
             neuroendocrine diseases, including diabetes mellitus and others);

         10. History of fever of 40 ¬∞C or more;

         11. History of elevated hepatic transaminases (above 2.5xULN);

         12. Episodes of thrombosis and/or thromboembolia in past medical history (myocardial
             infarction, stroke, transient ischemic attacks, deep vein thrombosis, pulmonary
             embolism within 6 months prior to inclusion in the study) as well as an increased risk
             of deep vein thrombosis;

         13. History of epileptic attacks or seizures;

         14. History or current (at screening) depression, suicidal thoughts/ attempts;

         15. Regular oral or parenteral use of any medications including over-the-counter drugs,
             vitamins and nutritional additives within 2 weeks before a scheduled injection of the
             test drug;

         16. Use of drugs, including OTC products, that significantly affect the hemodynamics,
             hepatic function, etc. (barbiturates, omeprazole, cimetidine, etc.) within 30 days
             before a scheduled injection of the test drug;

         17. Vaccination within 4 weeks before a scheduled injection of the test drug;

         18. Smoking more than 10 cigarettes per day;

         19. Consumption of more than 10 portions of alcohol per week (one portion equals to 0.5 L
             of beer, 200 mL of wine or 50 mL of ethanol) or a history of alcohol, drug or
             medication abuse;

         20. Participation in other clinical studies within 1 month before screening or
             simultaneous participation in another clinical study;

         21. Previous participation in this study.
